import React from 'react';
import { configureStore } from 'redux';

const initValues = {
    data: []
};

function reducer(state = initValues, action){
    switch (action.type) {
        case "GET" :
            return {
                ...state,
                data : [...data]
            }
        default:
            return state;
    }
}

const store = configureStore(reducer);

export default store;
